-- /////////////////////////////////////////////////////////////


IF EXISTS (SELECT * FROM sys.objects WHERE object_id = OBJECT_ID(N'[dbo].[PG_CI_CUENTA_BANCO]') AND type in (N'P', N'PC'))
	DROP PROCEDURE [dbo].[PG_CI_CUENTA_BANCO]	
GO

CREATE PROCEDURE [dbo].[PG_CI_CUENTA_BANCO]
	@PP_L_DEBUG						INT,
	@PP_K_SISTEMA_EXE				INT,
	@PP_K_USUARIO_ACCION			INT,	
	@PP_K_CUENTA_BANCO				INT,			
	@PP_D_CUENTA_BANCO				VARCHAR (100), 
	@PP_S_CUENTA_BANCO				VARCHAR (10),	
	@PP_O_CUENTA_BANCO				INT,			
	@PP_C_CUENTA_BANCO				VARCHAR (255), 
	@PP_K_RAZON_SOCIAL				INT,			
	@PP_K_BANCO						INT,			
	@PP_K_MONEDA					INT,			
	@PP_NUMERO_PLAZA				VARCHAR (10),	
	@PP_NUMERO_SUCURSAL				VARCHAR (10),	
	@PP_CUENTA						VARCHAR (100), 
	@PP_CLABE						VARCHAR (100), 
	@PP_K_ESTATUS_CUENTA_BANCO		INT,			
	@PP_K_TIPO_CUENTA_BANCO			INT,			
	@PP_F_APERTURA					DATE,		
	@PP_EJECUTIVO					VARCHAR (200),
	@PP_TELEFONO					VARCHAR(100),	
	@PP_CALLE						VARCHAR(100),	
	@PP_NUMERO_EXTERIOR				VARCHAR(100),	
	@PP_NUMERO_INTERIOR				VARCHAR(100),	
	@PP_COLONIA						VARCHAR(100),	
	@PP_CP							VARCHAR(100),	
	@PP_POBLACION					VARCHAR(100),	
	@PP_MUNICIPIO					VARCHAR(100),	
	@PP_APODERADO					VARCHAR(100),	
	@PP_K_ESTADO					INT		
AS

	INSERT INTO CUENTA_BANCO
		(		K_CUENTA_BANCO,			D_CUENTA_BANCO,
				S_CUENTA_BANCO,			O_CUENTA_BANCO,
				C_CUENTA_BANCO,			K_RAZON_SOCIAL,
				-- ==============================================
				K_BANCO,				K_MONEDA,				
				NUMERO_PLAZA,			NUMERO_SUCURSAL,			
				CUENTA,					CLABE,		
				-- ==============================================
				K_ESTATUS_CUENTA_BANCO,	K_TIPO_CUENTA_BANCO,
				F_APERTURA,			
				EJECUTIVO,				TELEFONO,
				-- ==============================================
				CALLE,					NUMERO_EXTERIOR,
				NUMERO_INTERIOR,		COLONIA,
				CP,						POBLACION,
				MUNICIPIO,				APODERADO,			
				K_ESTADO,
				-- ==============================================
				[K_USUARIO_ALTA],[F_ALTA],[K_USUARIO_CAMBIO],[F_CAMBIO],
				L_BORRADO,			K_USUARIO_BAJA,
				F_BAJA			
		)
	VALUES	
		(		@PP_K_CUENTA_BANCO,			@PP_D_CUENTA_BANCO,
				@PP_S_CUENTA_BANCO,			@PP_O_CUENTA_BANCO,
				@PP_C_CUENTA_BANCO,			@PP_K_RAZON_SOCIAL,			
				-- ==============================================
				@PP_K_BANCO,				@PP_K_MONEDA,
				@PP_NUMERO_PLAZA,			@PP_NUMERO_SUCURSAL,
				@PP_CUENTA,					@PP_CLABE,
				-- ==============================================
				@PP_K_ESTATUS_CUENTA_BANCO,	@PP_K_TIPO_CUENTA_BANCO,
				@PP_F_APERTURA,			
				@PP_EJECUTIVO,				@PP_TELEFONO,
				-- ==============================================
				@PP_CALLE,					@PP_NUMERO_EXTERIOR,
				@PP_NUMERO_INTERIOR,		@PP_COLONIA,
				@PP_CP,						@PP_POBLACION,
				@PP_MUNICIPIO,				@PP_APODERADO,				
				@PP_K_ESTADO,
				-- ==============================================
				@PP_K_USUARIO_ACCION, GETDATE(), 
				@PP_K_USUARIO_ACCION, GETDATE(),
				0,							NULL,
				NULL
		)
GO



