-- SELECT * FROM CUENTA_BANCO


-- ===============================================
SET NOCOUNT ON

-- ===============================================

UPDATE	CUENTA_BANCO
SET		S_CUENTA_BANCO = ''
GO

UPDATE	CUENTA_BANCO
SET		S_CUENTA_BANCO = S_CUENTA_BANCO + (	SELECT S_BANCO
											FROM	BANCO 
											WHERE	BANCO.K_BANCO=CUENTA_BANCO.K_BANCO )
GO


UPDATE	CUENTA_BANCO
SET		S_CUENTA_BANCO = S_CUENTA_BANCO + '-' + RIGHT(CUENTA,5) 
GO

-- ==================================


UPDATE	CUENTA_BANCO
SET		D_CUENTA_BANCO = ''
GO

UPDATE	CUENTA_BANCO
SET		D_CUENTA_BANCO = D_CUENTA_BANCO + (	SELECT	S_TIPO_CUENTA_BANCO
											FROM	TIPO_CUENTA_BANCO
											WHERE	TIPO_CUENTA_BANCO.K_TIPO_CUENTA_BANCO=CUENTA_BANCO.K_TIPO_CUENTA_BANCO )
GO

UPDATE	CUENTA_BANCO
SET		D_CUENTA_BANCO = '[X] ' + D_CUENTA_BANCO ,
		O_CUENTA_BANCO = 99999
WHERE	K_ESTATUS_CUENTA_BANCO=2
GO

UPDATE	CUENTA_BANCO
SET		D_CUENTA_BANCO = '.' + D_CUENTA_BANCO 
WHERE	K_ESTATUS_CUENTA_BANCO=1
GO

UPDATE	CUENTA_BANCO
SET		D_CUENTA_BANCO = D_CUENTA_BANCO + ' > ' + S_CUENTA_BANCO
GO



UPDATE	CUENTA_BANCO
SET		D_CUENTA_BANCO = D_CUENTA_BANCO +' | '+ (	SELECT	D_RAZON_SOCIAL
													FROM	RAZON_SOCIAL
													WHERE	RAZON_SOCIAL.K_RAZON_SOCIAL=CUENTA_BANCO.K_RAZON_SOCIAL )
GO

UPDATE	CUENTA_BANCO
SET		D_CUENTA_BANCO = D_CUENTA_BANCO + ' > ' + TELEFONO
GO



UPDATE	CUENTA_BANCO
SET		O_CUENTA_BANCO = 99999
WHERE	K_ESTATUS_CUENTA_BANCO=2
GO

UPDATE	CUENTA_BANCO
SET		O_CUENTA_BANCO = 88888
WHERE	K_ESTATUS_CUENTA_BANCO=1
GO

UPDATE	CUENTA_BANCO
SET		O_CUENTA_BANCO = 0
WHERE D_CUENTA_BANCO LIKE '%BUTEP%'
GO

